{
    "openapi": "3.0.0",
    "info": {
        "title": "Customer Credit API",
        "description": "This documentation describes the available REST APIs for VTEX Customer Credit.\n\nWith Customer Credit you can enable credit payments on the Smartcheckout of your store, besides controlling invoices and your clients credit limits.\n[Learn more about this at Help Center](https://help.vtex.com/en/tutorial/credit-control-overview)\n\n\n\nAll requests need the authorization header.\n\nThis API allow two kinds of authorization:\n1. Authorization header containing the VTEX Id authentication token \n2. VTEX Appkey and Apptoken headers",
        "contact": {},
        "version": "1.0"
    },
    "servers": [
        {
            "url": "https://{accountName}.{environment}.com.br",
            "description": "VTEX server url",
            "variables": {
                "accountName": {
                    "description": "Name of the VTEX account. Used as part of the URL",
                    "default": "{accountName}"
                },
                "environment": {
                    "description": "Environment to use. Used as part of the URL.",
                    "default": "{environment}"
                }
            }
        }
    ],
